import { UnorderedListOutlined } from "@ant-design/icons/lib/icons";
import { List } from "antd/lib/form/Form";
import React from "react";

function Slidebar() {
  const data = [
    {
      title: "Ant Design Title 1",
    },
    {
      title: "Ant Design Title 2",
    },
    {
      title: "Ant Design Title 3",
    },
    {
      title: "Ant Design Title 4",
    },
  ];
  return (
    <div className="slide-bar">
      <div className="slide-bar-category">
        <div className="slide-bar-category-title">
          <UnorderedListOutlined /> All Category
        </div>
        <div className="slide-bar-category-list">
          <ul>
            <li></li>
          </ul>

          <List
            itemLayout="horizontal"
            dataSource={data}
            renderItem={(item) => (
              <List.Item>
                <List.Item.Meta
                  avatar={<Avatar src="https://joeschmoe.io/api/v1/random" />}

                  title={<a href="https://ant.design">{item.title}</a>}
                  description="Ant Design, a design language for background applications, is refined by Ant UED Team"
                />
              </List.Item>
            )}
          />
        </div>
      </div>
    </div>
  );
}

export default Slidebar;
